import React, { Component } from 'react';

class Projects extends Component {
    constructor(props) {
    super(props);
    this.state = {date: new Date()};
    }   
  
    render() {
        return (
        <div>
            <h1>Hello, world!</h1>
            <h2>It is {this.state.date.toLocaleTimeString()}.</h2>
        </div>
        );
    }
}
export default Projects;
